import raw from './assets/LifeSimulation01.xml';

class map
{
      constructor()
      {
            this.map_height = 0.0;
            this.map_width = 0.0;   
            this.num_plants = 0;   
      }
      get width() { return this.map_width; }
      set width(num) { this.map_width = num; }
      get height() { return this.map_height; }
      set height(num) { this.map_height = num; } 
      get num_initial_plants() { return this.num_plants }
      set num_initial_plants(num) { this.num_plants = num }
}

class plant
{
      constructor()
      {
            this.x = 0;
            this.y = 0;
            this.diameter = 0.0;
      }
      set x_coord(num) { this.x = num; }
      get x_coord() { return this.x; }
      get y_coord() { return this.y; }
      set y_coord(num) { this.y = num; }
      get diam() { return this.diameter; }
      set diam(num) { this.diameter = num; }
}

const map1 = new map();
const plant1 = new plant();

let plants = [];


fetch(raw)
            .then(r=>r.text())
            .then(text=>{

                  let lines =  text.split('\n');
                  map1.width = parseFloat(lines[3]);
                  map1.height = parseFloat(lines[6]);
                  map1.num_initial_plants = parseInt(lines[11]);
                  
                  for (let i = 0; i < (map1.num_initial_plants); i += 11){
                        plant1.x = parseInt(lines[30]);
                        plant1.y = parseInt(lines[33]);
                        plant1.diameter = parseFloat(lines[36]);
                        plants.push(plant1);
                  }
            })

export {map1, plants, plant1 };//,
